import React from 'react';
import Animation from '../App/Animation'; // Import the Animation component
import { Link } from 'react-router-dom';

const AnimationPage = () => {
  return (
    <div>
      <Animation /> {/* Use the Animation component */}
      <div style={{ textAlign: 'center', marginTop: '20px' }}>
        <Link to="/" style={{ fontSize: '20px', color: '#0000EE' }}>Go to Main Website</Link>
      </div>
    </div>
  );
};

export default AnimationPage;
